import { actionTypes } from '../actions/register.action';

const initialState = {
  user: {
    'name': '',
    'email': '',
    'password': '',
  },
  success: false,
  error: {}
}

export default (state = initialState, { type, data }) => {
  switch (type) {
    case actionTypes:
      return { ...state, ...data }

    default:
      return state
  }
}
